import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';

const Result = () => {
    const [results, setResults] = useState([{
      'min_cpu': 'null',
      'min_gpu': 'null',
      'min_ram': 'null',
      'rec_cpu': 'null',
      'rec_gpu': 'null',
      'rec_ram': 'null'
    }]);
    const get_datas = async (target) =>{
      try {
        const response = await fetch(`http://localhost:3001/api/request_data?game=${target}`);
        if (response.ok) {
            const data = await response.json();
            console.log(data);
            console.log(response);
            setResults(data)
        } else {
            console.error('inside if Failed to fetch suggestions:', response.status);
        }
      } catch (error) {
      console.error('Failed to fetch suggestions:', error);
      }
    }
      // get info 
    useEffect(() => {
      if(game_name) {
        get_datas(game_name);
      }
    }, [game_name]); 
    const location = useLocation();

    const { game_name, user_cpu, user_gpu, user_ram } = location.state || {};

    return (
        <div>
            <div className='result'>
                'game name': {game_name}
                <br/>
                'user_cpu': {user_cpu}
                <br/>
                'user_gpu': {user_gpu}
                <br/>
                'user_ram': {user_ram}
                <br/>
                'min_cpu': {results[0].min_cpu}
                <br/>
                'min_gpu': {results[0].min_gpu}
                <br/>
                'min_ram': {results[0].min_ram}
                <br/>
                'rec_cpu': {results[0].rec_cpu}
                <br/>
                'rec_gpu': {results[0].rec_gpu}
                <br/>
                'rec_ram': {results[0].rec_ram}
            </div>
        </div>
    );
};

export default Result;
